import "./password.css"
import Up from "./Images/up.png";
import Card from "react-bootstrap/Card";

const PasswordComponenet = () => {
    return (
      <div className="fullpage">
        <Card style={{ width: "10rem" }}>
          <Card.Img className="imgup" src={Up} />
        </Card>
      </div>
    );
}
 
export default PasswordComponenet;
